import '../App.css'
export default function Home(){
    return(
        <div className="home-main" >
            <div className="home-wraper">
                <Link to={'/Step1'}>რეზიუმეს დამატება</Link>
                {/* <img className="home-image" src="../images/LOGO-40 1.png" alt="" /> */}
                <div className="home-image"></div>
            </div>
        </div>

    )
}
